import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAlignRight } from '@fortawesome/free-solid-svg-icons';
import { faSearch} from '@fortawesome/free-solid-svg-icons';
import Search from './search';
// import {Carousel} from 'react-bootstrap';
// import b1 from './images/b1.jpg';
// import b2 from './images/b2.jpg';
// import b3 from './images/b3.jpg';
// import {Button} from 'react-bootstrap';
// import Slider from './slider';
// import {Animated} from "react-animated-css";
// import About from './about';
// import Manatee from '../Manatee/Manatee';
// import Narwhal from '../Narwhal/Narwhal';
// import Whale from '../Whale/Whale';
import { BrowserRouter as Router,Route,Switch,Link } from 'react-router-dom';
import Happy from './Views/happy';
import Fool from './Views/fool';
// import Contact from './contact';
import About from './Views/about';

function Header(props){
const [isdisplay,setdisplay]=useState(false);

function handleClick(){
setdisplay(true)
}
    return <div>
   
<header id="site-header" class="fixed-top">


    <div className="container">
      <nav className="navbar navbar-expand-lg navbar-dark stroke">
        <h1>
          <a className="navbar-brand" href="index.html">
            <span> <FontAwesomeIcon  icon={faAlignRight}  className="logo-style"/>  </span> Corp Vision <span className="logo">Vision to your Future</span></a>
        </h1>
     

 <p>{isdisplay?<Search/>:null}</p>
          <a className="navbar-brand" href="#index.html">
              <img src="image-path" alt="" title="" style={{height:"35"}}/>
          </a>
        <button className="navbar-toggler  collapsed bg-gradient" type="button" data-toggle="collapse"
          data-target="#navbarTogglerDemo02" aria-controls="navbarTogglerDemo02" aria-expanded="false"
          aria-label="Toggle navigation">
          <span className="navbar-toggler-icon fa icon-expand fa-bars"></span>
          <span className="navbar-toggler-icon fa icon-close fa-times"></span>
        </button>
  
        <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
          <ul className="navbar-nav mx-lg-auto">
            <li className="nav-item active">
              <a className="nav-link" href="index.html">Home <span className="sr-only">(current)</span></a>
            </li>
            <li className="nav-item @@about__active">
          
             
            </li>
            <li className="nav-item @@services__active">
           
            </li>
            <li className="nav-item @@contact__active">
              <a className="nav-link" href="contact.html">Contact</a>

              <Router>

             <Switch>
               <Link to="/about"> About </Link>
               </Switch>
               <Switch>
               <Link to="/contact"> contact </Link>
               </Switch>
               <Switch>
               <Link to="/abb"> abb </Link>
               </Switch>
                <Route path="/about">
               <Fool/>
                </Route>
                <Route path="/contact">
       <Happy/>
                </Route>
                <Route path="/abb">
       <About/>
                </Route>
              </Router>
            </li>
          </ul>
          <div>
     
    </div>

     


          </div>
  
         
          <div className="header-search">
            <div className='control mr-3'>
              <div className='btn-material'>
                <i></i>
                <FontAwesomeIcon icon={faSearch}  className='fa fa-search icon-material-search' onClick={handleClick}/>
              </div>
            </div>
      
            <i className='icon-close fa fa-close material-icons'></i>
          
          </div>
       
          <div className="mobile-position">
            <nav className="navigation">
              <div className="theme-switch-wrapper">
                <label className="theme-switch" for="checkbox">
                  <input type="checkbox" id="checkbox"/>
                  <div className="mode-container py-1">
                    <i className="gg-sun"></i>
                    <i className="gg-moon"></i>
                  </div>
                </label>
              </div>
            </nav>
          </div>
       
      </nav>

    </div>
  </header>
  
  



   
  </div>
  


}


export default Header;
